import styled from "styled-components";

export const StyledPricing = styled.div`
  border: 1px solid #a5a4a7;
  border-radius: 3px;
  background-color: #d3d2d6;


  .grid5x2 {
    display: flex;
    flex-direction: row;
  }
  .grid5x2 > div {
    display: flex;
    flex-direction: ROW;
    padding: 2px;
  }

  
`;
